import React from 'react';
import AdvertContent from './AdvertContent';
import './Advert.css';
import ButtonAds from '../slider/ButtonAds';
import danadevolk from "../../assets/dana-devolk.png";
import aplikacja from "../../assets/aplikacja.png";

const Advert = () =>{
    return(
        <section className='advert'>
            <div className='advert__wrapper'>
                <div className="advert__left">
                    <img src={danadevolk} className="advert__img"/>
                    <div className="advert__desc">
                        <AdvertContent header=''/>
                        <h2 className="advert__header">Zestaw dla 3 osób</h2>
                        <p className="advert__info">Razem smakuje lepiej! Zamów zestawy obiadowy dla 3 osób już od <span className="advert__feature">39 zł</span> </p>
                        <ButtonAds text='Zamów online'/>
                    </div>
                </div>
                <div className="advert__right">
                    <img src={aplikacja} className="advert__img"/>
                </div>
            </div>
        </section>
    )
}

export default Advert;
